import React, { Component } from 'react';
const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
    height:'100vh',
  },
  root: {
    maxWidth: '100%',
    flexGrow: 1,
    marginTop: '80px',
  },
  containerHeader: {
    display: 'flex',
    padding: '0 8px',
    alignItems: 'center',
    justifyContent: 'space-between',
    marginBottom: '16px',
    color: 'white !important',
    fontWeight: 'none',
  },


});

class error404 extends Component {

  render(){
    const { classes } = this.props;

    return(
      <div>
      <div className={classes.container}>
      <h1>Hola, soy el error 404</h1>
      </div>
      </div>
      );
  }
}

export default withStyles(styles)(error404);
